function FnIniciaSessao($cod_empresa,$CHAVE)
{
       
        $options = [
                    'http' => [
                        'method' => 'POST',
                         'header' => [
                                        'Content-Type: application/json',
                                        'Authorization: Bearer '.$CHAVE.''
                                    ]
                    ],
        ];
        $context = stream_context_create($options);
        $handle = fopen( "https://wpp.pndtecnologia.com.br/api/$cod_empresa/THISISMYSECURETOKEN/generate-token", "r",false, $context);

            if ( ! is_resource( $handle )) {
                echo 'sorry';
                exit;
            }

               while (!feof($handle)) {
                        @$contents.= fread($handle, 8192);
                    }
            fclose($handle);
          $connect=json_decode ($contents,true); 
          return $connect;
        
}


