function FnEnvioText($cod_empresa,$CHAVE,$json)
{
     
    //INICIA O LOOPING PARA ENVIAR MAIS DE 1
    
    foreach ($json AS $key)
    {
        $JSONm=json_encode($key,JSON_PRETTY_PRINT);
       
        $options = [
                    'http' => [
                        'method' => 'POST',
                         'header' => [
                                        'Content-Type: application/json',
                                        'Authorization: Bearer '.$CHAVE.''
                                      ],
                        'content' =>  $JSONm,
                        'timeout' => 30,
                    ],
        ];
        $context = stream_context_create($options);
        $handle = fopen( "https://wpp.pndtecnologia.com.br/api/$cod_empresa/send-message", "r",false, $context);
        sleep(2);

            if ( ! is_resource( $handle )) {
                $error = error_get_last();
                $errorMessage = isset($error['message']) ? $error['message'] : 'Unknown error';

                $results[] = array(
                                    'success' => false,
                                    'error' => 'Error opening the connection: ' . $errorMessage,
                );
                
                
            }

               while (!feof($handle)) {
                        @$contents.= fread($handle, 8192);
                    }
          $connect=json_decode ($contents,true); 
    }  
          fclose($handle);
          return [$connect,$results];
        
}
