function FnEnvioMULT($cod_empresa,$CHAVE,$json)
{
     
    //INICIA O LOOPING PARA ENVIAR MAIS DE 1
    //,'Authorization: Bearer '.$CHAVE.''
       
        $JSONm=json_encode($json,JSON_NUMERIC_CHECK);
        $options = [
                    'http' => [
                        'method' => 'POST',
                         'header' => [
                                        'Content-Type: application/json'
                                      ],
                        'content' =>  $JSONm,
                        'timeout' => 300, 
                    ],
        ];
        $context = stream_context_create($options);
                        
        $handle = fopen( "https://n8n.whatsatende.com.br/webhook/49e48498-c5a4-4023-be31-fde39d5583c7", "r",false, $context);

            if ( ! is_resource( $handle )) {
                $error = error_get_last();
                $errorMessage = isset($error['message']) ? $error['message'] : 'Unknown error';

                $results[] = array(
                                    'success' => false,
                                    'error' => 'Error opening the connection: ' . $errorMessage,
                );
               
            }

               while (!feof($handle)) {
                       if(!$handle)
                       {
                           exit(); 
                       }    
                        @$contents.= fread($handle, 8192);
                    }
          $connect=json_decode ($contents,true); 
     
           fclose($handle);
           return [$connect,$results,$JSONm];
        
}